(function(){window.Utils={},Utils.display_default_error=function(){var r;return r="An unknown error occurred."},Utils.display_error=function(r){var e;switch(r.code){case r.PERMISSION_DENIED:return e="User denied the request for Geolocation.";case r.POSITION_UNAVAILABLE:return e="Location information is unavailable.";case r.TIMEOUT:return e="The request to get user location timed out.";case r.UNKNOWN_ERROR:return e="An unknown error occurred."}},Utils.handle_error=function(r){return console.log(r)}}).call(this);